,302,'_edit_lock','1429246816:1'),(585,305,'_menu_item_type','post_type'),(586,305,'_menu_item_menu_item_parent','0'),(587,305,'_menu_item_object_id','300'),(588,305,'_menu_item_object','page'),(589,305,'_menu_item_target',''),(590,305,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(591,305,'_menu_item_xfn',''),(592,305,'_menu_item_url',''),(594,300,'_spyropress_builder_data','a:1:{s:25:\"builder-row-5527709e75635\";a:4:{s:4:\"type\";s:17:\"one_col_row_class\";s:7:\"options\";a:0:{}s:7:\"columns\";a:1:{s:28:\"builder-column-5527727f98f1a\";a:3:{s:4:\"type\";s:6:\"col_11\";s:9:\"col_class\";s:41:\"span12 col-sm-12 column_first column_last\";s:7:\"modules\";a:3:{s:28:\"builder-module-552772ab4be74\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:14:\"PRIVACY NOTICE\";s:4:\"text\";s:214:\"This Privacy Notice (“Notice”) describes how MediCloud Holdings Pte Ltd and its respective subsidiaries, associate companies and jointly controlled entities (“MediCloud Group”) use your Personal Data.\n\n				\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-5527744a4dcb3\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:27:\"COLLECTION OF PERSONAL DATA\";s:4:\"text\";s:3926:\"“Personal Data” means information about you, from which you are identifiable, including but not limited to your name, identification card number, birth certificate number, passport number, nationality, address, telephone number, fax number, bank details, credit card details, race, gender, date of birth, marital status, resident status, education background, financial background, personal interests, email address, your occupation, your designation in your MediCloud Group, your MediCloud Group details, the industry in which you work in, any information about you which you have provided to MediCloud Group in registration forms, application forms or any other similar forms and/or any information about you that has been or may be collected, stored, used and processed by MediCloud Group from time to time and includes sensitive personal data such as data relating to health, religious or other similar beliefs. \n<br /><br />\nThe provision of your Personal Data is voluntary. However if you do not provide MediCloud Group your Personal Data, MediCloud Group will not be able to process your Personal Data for the Purposes and Additional Purposes outlined below.<br /><br />\n\nIf you are an agent, vendor, supplier or service provider, provision of your Personal Data is mandatory and failure to provide your Personal Data, may be a breach of laws or regulatory requirements, and may cause MediCloud Group to be unable to engage you to provide services or products or issue payments to you for products or services provided.<br /><br />\n\nIn addition to the Personal Data you provide to MediCloud Group directly, MediCloud Group may collect your Personal Data from a variety of sources such as:\nFill up application or registration forms or other similar forms; From publicly available sources such as directories, From MediCloud Group’s social media pages, if you follow, like or are a fan of such pages; From credit reporting agencies; When you interact and communicate with MediCloud Group at any events or activities; When you enter contests organized by MediCloud Group, From various entities or divisions under MediCloud Group; or By using MediCloud Group websites, which includes all websites operated by MediCloud Group and under the names of its respective brands (“Websites”). Your personal data may also be collected from cookies used on the Websites. Purposes of Processing<br><br>\n\nMediCloud Group may use and process your Personal Data for business and activities of\nMediCloud Group which shall include, without limitation the following (“Purpose”):<br><br>\n\nWhere you are a customer of the services provided by MediCloud Group:\nto perform the MediCloud Group’s obligations in respect of any contract entered into with you; to provide you with any service you have requested; to process your subscriptions and to deliver the services to you; where you have requested to download and use the MediCloud App (“App”), to process your request, to deliver the App to you and to provide you a license for the use of the App; to process your participation in any events, activities, focus groups, research studies, contests, promotions, polls, surveys or any productions; to process, manage or verify your application for subscription with the MediCloud Group and to provide you the benefits offered to subscribers; to validate your bookings and process payments relating to any products or services you have requested; to understand and analyses our sales as well as your needs and preferences; to develop, enhance and provide products and services to meet your needs; to process exchanges or product returns;<br><br>\n\nfor the purposes of engaging you to provide services or products; to facilitate or enable any checks as may be required by MediCloud Group in order to engage you; to process payments relating to any products or services you have provided; to contact you or your MediCloud Group;\n\n\";s:6:\"filter\";b:0;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-552775a21d6c8\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:8:\"GENERAL:\";s:4:\"text\";s:7587:\"to respond to questions, comments and feedback from you; to communicate with you for any of the purposes listed in this Notice; for internal administrative purposes, such as auditing, data analysis, database records; for purposes of detection, prevention and prosecution of crime; for MediCloud Group to comply with its obligations under law; and you agree and consent to MediCloud Group using and processing your Personal Data for the Purposes and in the manner as identified in this Notice.<br/><br/>\n\nMarketing and Promotional Purposes\nMediCloud Group may also use and process your data for other purposes such as (“Additional Purposes”):<br />\nTo send you alerts, newsletters, updates, mailers, promotional materials, special privileges, festive greetings from MediCloud Group, its partners, sponsors or advertisers; To notify and invite you to events or activities organized by MediCloud Group, its partners, sponsors or advertisers; To process your registration to participate in or attend an event or activity and to communicate with you regarding your attendance at the event or activity; To share your Personal Data amongst its subsidiaries, associate companies and jointly controlled entities as well as with its agent, vendor, supplier, partner, contractor or service provider who may communicate with you to market their products, services, events or promotions. by way of post, telephone call, short message service (SMS), by hand and/or by email.<br/><br/>\n\nUnsubscribe and Revocation of Consent\nIf you wish to unsubscribe to the processing of your Personal Data for Additional Purposes by MediCloud Group, please click on the link “Unsubscribe” which is embedded in the relevant email in order not to receive any email in the future.\nIf you wish to revoke the consent that MediCloud Group has obtained from you for the Purposes stipulated herein, please notify MediCloud Group using the contact details stated below.<br/><br/>\n\nTransfer of Personal Data\nYour Personal Data may be transferred to, stored, used and processed in a jurisdiction other than your home nation or otherwise in the country, state and city in which you are present while using any services provided by MediCloud Group (“Alternate Country”), to companies under MediCloud Group which are located outside of your home nation or Alternate Country and/or where MediCloud Group’s servers are located outside of your home nation or Alternate Country. You understand and consent to the transfer of your Personal Data out of your home nation or Alternate Country as described herein.<br/><br/>\n\nDisclosure to Third Parties\nYour personal data may be transferred, accessed or disclosed to third parties for the Purposes and Additional Purposes. Further, MediCloud Group may engage other companies, service providers or individuals to perform functions on its behalf, and consequently may provide access or disclose to your Personal Data to such service providers or third parties. The third parties include, without limitation: <br /><br/>\n\nMediCloud Group partners, which include parties with whom MediCloud Group collaborates with for certain events, programs and activities; Event management companies and event sponsors; Marketing research companies; Service providers, including, information technology (IT) service providers for infrastructure, software and development work; Professional advisors and external auditors, including legal advisors, financial advisors and consultants; Other entities within MediCloud Group; and Governmental authorities to comply with statutory, regulatory and governmental requirements.<br/><br/>\n\nYour Personal Data may also be shared in connection with a corporate transaction, such as a sale of a subsidiary or a division, merger, consolidation, or asset sale, or in the unlikely event of winding-up.<br><br>\n\nAccess & Correction Requests and Inquiries, Limiting the Processing of Personal Data\nSubject to any exceptions under applicable laws of your home nation or Alternate Country, you may request for access to and/or request correction of your Personal Data, request to limit the processing of your Personal Data for the Additional Purposes and/or make any inquiries regarding your Personal Data by contacting:<br><br>\n\nMediCloud Pte Ltd 70 Anson Road, Hub Synergy Point B1, S079905 Email: info@medicloud.sg\nSubject to any laws of your home nation or Alternate Country, MediCloud Group reserves the right to impose a fee for access of your Personal Data in the amounts as permitted therein.<br><br>\n\nIn respect of your right to access and/or correct your Personal Data, MediCloud Group has the right to refuse the your requests to access and/or make any correction to your Personal Data for the reasons permitted under law, such as where the expense of providing access to you is disproportionate to the risks to your or another person’s privacy.<br><br>\n\nIf you do not wish for your Personal Data to be collected via cookies on the Websites, you may deactivate cookies by adjusting your internet browser settings to disable, block or deactivate cookies, by deleting your browsing history and clearing the cache from your internet browser.<br><br>\n\nLinks to Third-Party Websites\nThe Websites may contain links to third parties’ websites. Please note that MediCloud Group is not responsible for the collection, use, maintenance, sharing, or disclosure of data and information by such third parties. If you provide information directly to such sites, the privacy policy and terms of service on those sites are applicable and MediCloud Group is not responsible for the information processing practices or privacy policies of such sites.<br/><br/>\n\nPersonal Information from Minors and Other Individuals\nAs a parent or legal guardian, please do not allow the minor (individuals under 18 (eighteen) years of age) under your care to submit Personal Data to MediCloud Group. In the event that such Personal Data is provided to MediCloud Group, you hereby consent to the processing of the minor’s Personal Data and personally accept and agree to be bound by this Notice and take responsibility for his or her actions.<br/><br/>\n\nIn some circumstances you may have provided personal data relating to other individuals (such as your spouse, family members or friends) and in such circumstances you represent and warrant that you are authorized to provide their personal data to MediCloud Group and you have obtained their consent for their personal data be processed and used in the manner as set forth in this Notice.<br/><br/>\n\nAcknowledgement and Consent\nBy communicating with MediCloud Group, using MediCloud Group’s services, purchasing products from MediCloud Group or by virtue of your engagement with MediCloud Group, you acknowledge that you have read and understood this Notice and agree and consent to the use, processing and transfer of your Personal Data by MediCloud Group as described in this Notice.<br/><br/>\n\nMediCloud Group shall have the right to modify, update or amend the terms of this Notice at any time by placing the updated Notice on the Websites. By continuing to communicate with MediCloud Group, by continuing to use MediCloud Group’s services, purchasing products from MediCloud Group or by your continued engagement with MediCloud Group following the modifications, updates or amendments to this Notice, such actions shall signify your acceptance of such modifications, updates or amendments.<br/><br/>\n\nIn the event of any conflict between the English and other language versions, the English version shall prevail.\n\n\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}}}}s:10:\"prev_width\";i:0;}}'),(604,296,'_spyropress_builder_data','a:1:{s:25:\"builder-row-5527764b97e15\";a:4:{s:4:\"type\";s:17:\"one_col_row_class\";s:7:\"options\";a:0:{}s:7:\"columns\";a:1:{s:28:\"builder-column-5527764b97e65\";a:3:{s:4:\"type\";s:6:\"col_11\";s:9:\"col_class\";s:41:\"span12 col-sm-12 column_first column_last\";s:7:\"modules\";a:16:{s:28:\"builder-module-5527765561063\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:32:\"Terms of Use for MediCloud Users\";s:4:\"text\";s:3052:\"Last modified: 22 June 2015 \nImportant – please read these terms carefully. By using this Service, you agree that you have read, understood, accepted and agreed with the Terms of Use. You further agree to the representations made by yourself below. If you do not agree to or fall within the Terms of Use of the Service (as defined below) and wish to discontinue using the Service, please do not continue using this Application or Service.\n\nThe Terms of Use stated herein (collectively, the “Terms of Use” or this “Agreement”) constitute a legal agreement between you and MediCloud Pte Ltd (Company No. 201415681W)(the “Company”). In order to use the Service (each as defined below) you must agree to the Terms of Use that are set out below. By using the mobile application supplied to you by the Company (the ”Application”), and downloading, installing or using any associated software supplied by the Company (“the Software”) which overall purpose is to enable persons seeking medical services to certain medical facilities to be matched with third party medical providers, doctors and clinic operators (collectively, the “Service”), you hereby expressly acknowledge and agree to be bound by the Terms of Use, and any future amendments and additions to this Terms of Use as published from time to time at <a href=\"http://www.medicloud.sg\">http://www.MediCloud.sg</a> or through the Application.\n\nThe Company reserves the right to modify, vary and change the Terms of Use or its policies relating to the Service at any time as it deems fit. Such modifications, variations and or changes to the Terms of Use or its policies relating to the Service shall be effective upon the posting of an updated version at <a href=\"http://www.medicloud.sg\">http://www.MediCloud.sg.</a> You agree that it shall be your responsibility to review the Terms of Use regularly and also the Terms of Use applicable to any country where you use the Service which may differ from the country where you registered for the Application (“the Alternate Country”) whereupon the continued use of the Service after any such changes, whether or not reviewed by you, shall constitute your consent and acceptance to such changes. You further agree that usage of the Service in the Alternate Country shall be subject to the Terms of Use prevailing for the Alternate Country which can be found at <a href=\"http://www.medicloud.sg\">http://www.MediCloud.sg.</a>\n\nTHE COMPANY IS A TECHNOLOGY COMPANY THAT DOES NOT PROVIDE MEDICAL SERVICES AND THE COMPANY IS NOT A MEDICAL PROVIDER. IT IS UP TO THE THIRD PARTY MEDICAL PROVIDERS TO OFFER MEDICAL SERVICES TO YOU AND IT IS UP TO YOU TO ACCEPT SUCH MEDICAL SERVICES. THE SERVICE OF THE COMPANY IS TO LINK YOU WITH SUCH MEDICAL PROVIDERS, BUT DOES NOT NOR IS IT INTENDED TO PROVIDE MEDICAL SERVICES OR ANY ACT THAT CAN BE CONSTRUED IN ANY WAY AS AN ACT OF A MEDICAL PROVIDER. THE COMPANY IS NOT RESPONSIBLE NOR LIABLE FOR THE ACTS AND/OR OMISSIONS OF ANY MEDICAL PROVIDER AND/OR ANY MEDICAL SERVICES PROVIDED TO YOU.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-5527767a07c62\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:30:\"Representations and Warranties\";s:4:\"text\";s:4389:\"By using the Service, you expressly represent and warrant that you are legally entitled to accept and agree to the Terms of Use and that you are at least eighteen (18) years old. Without limiting the generality of the foregoing, the Service is not available to persons under the age of eighteen (18) or such persons that are forbidden for any reason whatsoever to enter into a contractual relationship. By using the Service, you further represent and warrant that you have the right, authority and capacity to use the Service and to abide by the Terms of Use. You further confirm that all the information which you provide shall be true and accurate. Your use of the Service is for your own sole, personal use. You undertake not to authorize others to use your identity or user status, and you may not assign or otherwise transfer your user account to any other person or entity. When using the Service you agree to comply with all applicable laws whether in your home nation or otherwise in the country, state and city in which you are present while using the Service (the “Alternate Country”).\n\nYou may only access the Service using authorized means. It is your responsibility to check and ensure that you have downloaded the correct Software for your device. The Company is not liable if you do not have a compatible device or if you have downloaded the wrong version of the Software to your device. The Company reserves the right not to permit you to use the Service should you use the Application and/or the Software with an incompatible or unauthorized device or for purposes other than which the Software and/or the Application is intended to be used.\n\nBy using the Software or the Application, you agree that:\nYou will only use the Service for lawful purposes; You will only use the Service for the purpose for which it is intended to be used; You will not use the Application for sending or storing any unlawful material or for fraudulent purposes; You will not use the Application and/or the Software to cause nuisance, annoyance, inconvenience or make fake bookings; You will not use the Service, Application and/or Software for purposes other than obtaining the Service; You shall not contact the Third Party Medical Provider for purposes other than the Service; You will not impair the proper operation of the network; You shall not intentionally or unintentionally cause or attempt to cause damage to the third party Medical provider; You will not try to harm the Service, Application and/or the Software in any way whatsoever; You will not copy, or distribute the Software or other content without written permission from the Company; You will only use the Software and/or the Application for your own use and will not resell it to a third party; You will keep secure and confidential your account password or any identification we provide you which allows access to the Service; You will provide us with whatever proof of identity we may reasonably request or require; You agree to provide accurate, current and complete information as required for the Service and undertake the responsibility to maintain and update your information in a timely manner to keep it accurate, current and complete at all times during the term of this Agreement. You agree that the Company may rely on your information as accurate, current and complete. You acknowledge that if your information is untrue, inaccurate, not current or incomplete in any respect, the Company has the right but not the obligation to terminate this Agreement and your use of the Service at any time with or without notice; You will only use an access point or data account (AP) which you are authorized to use; You shall not employ any means to defraud the Company or enrich yourself, through any means, whether fraudulent or otherwise, through any event, promotion or campaign launched by the Company to encourage new subscription or usage of the Service by new or existing Users; You are aware that when requesting Medical services by SMS or use of the Service, standard telecommunication charges will apply; You shall not impair or circumvent the proper operation of the network which the Service operates on; You agree that the Service is provided on a reasonable effort basis; and You agree that your use of the Service will be subject to the Company’s Privacy Policy as may be amended from time to time.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-552776c2d7502\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:7:\"Payment\";s:4:\"text\";s:2116:\"You may choose to pay for the Service by cash and where available, by credit card and or debit card (“Card”). In the event that you choose to pay for the Service by Card, you will need to register a valid Card in accordance with the instructions within the Application. You agree that we may verify and authorize your Card details when you first register the Card with us as well as when you use the Service.\n\nWhen you register for the Service, you will have the option to pre-set a default “tip” amount of your choosing. This will automatically be added to the taxi fee at the end of each journey and given to the driver unless you choose to override it with a different tip amount or to remove the tip. Once you have completed a journey using the Service, you are required to make payment in full to the third party provider and your payment will be deducted automatically and is non- refundable. If you have any complaints in relation to the taxi service provided, then that dispute must be taken up with the taxi driver directly.\n\nWe have the right to suspend the processing of any transaction where we reasonably believe that the transaction may be fraudulent, illegal or involves any criminal activity or where we reasonably believe you to be in breach of the Terms of Use. You agree that you will cooperate in relation to any financial crime screening that is required and to assist us in complying with any prevailing laws or regulations in place. You shall be responsible to resolve any disputes with your Card company on your own.\n\nTaxes You agree that this Agreement shall be subject to all prevailing statutory taxes, duties, fees, charges and/or costs, however denominated, as may be in force and in connection with any future taxes that may be introduced at any point of time. You further agree to use your best efforts to do everything necessary and required by the relevant laws to enable, assist and/or defend the Company to claim or verify any input tax credit, set off, rebate or refund in respect of any taxes paid or payable in connection with the Services supplied under this Agreement.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-552776d7b6eab\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:28:\"License Grant & Restrictions\";s:4:\"text\";s:3054:\"The Company and its licensors, where applicable, hereby grants you a revocable, non-exclusive, non- transferable, non-assignable, personal, limited license to use the Application and/or the Software, solely for your own personal, non-commercial purposes, subject to the Terms of Use herein. All rights not expressly granted to you are reserved by the Company and its licensors.\n\nYou shall not (i) license, sublicense, sell, resell, transfer, assign, distribute or otherwise commercially exploit or make available to any third party the Application and/or the Software in any way; (ii) modify or make derivative works based on the Application and/or the Software; (iii) create internet “links” to the Application or “frame” or “mirror” any Software on any other server or wireless or internet-based device; (iv) reverse engineer or access the Software in order to (a) build a competitive product or service, (b) build a product using similar ideas, features, functions or graphics of the Application and/or the Software, or (c) copy any ideas, features, functions or graphics of the Application and/or the Software, (v) launch an automated program or script, including, but not limited to, web spiders, web crawlers, web robots, web ants, web indexers, bots, viruses or worms, or any program which may make multiple server requests per second, or unduly burdens or hinders the operation and/or performance of the Application and/or the Software, (vi) use any robot, spider, site search/retrieval application, or other manual or automatic device or process to retrieve, index, “data mine”, or in any way reproduce or circumvent the navigational structure or presentation of the Services or its contents; (vii) post, distribute or reproduce in any way any copyrighted material, trademarks, or other proprietary information without obtaining the prior consent of the owner of such proprietary rights, (viii) remove any copyright, trademark or other proprietary rights notices contained in the Service.\n\nYou may use the Software and/or the Application only for your personal, non-commercial purposes and shall not use the Software and/or the Application to: (i) send spam or otherwise duplicative or unsolicited messages; (ii) send or store infringing, obscene, threatening, libelous, or otherwise unlawful or tortious material, including but not limited to materials harmful to children or violative of third party privacy rights; (iii) send material containing software viruses, worms, trojan horses or other harmful computer code, files, scripts, agents or programs; (iv) interfere with or disrupt the integrity or performance of the Software and/or the Application or the data contained therein; (v) attempt to gain unauthorized access to the Software and/or the Application or its related systems or networks; or (vi) Impersonate any person or entity or otherwise misrepresent your affiliation with a person or entity (vii) to abstain from any conduct that could possibly damage the Company’s reputation or amount to being disreputable.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-5527776ea4235\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:31:\"Intellectual Property Ownership\";s:4:\"text\";s:1055:\"The Company and its licensors, where applicable, shall own all right, title and interest, including all related intellectual property rights, in and to the Software and/or the Application and by extension, the Service and any suggestions, ideas, enhancement requests, feedback, recommendations or other information provided by you or any other party relating to the Service. The Terms of Use do not constitute a sale agreement and do not convey to you any rights of ownership in or related to the Service, Software and/or the Application, or any intellectual property rights owned by the Company and/or its licensors. The Company name, the Company logo, the Service, the Software and/or the Application and the Medical Providers’ logos and the product names associated with the Software and/or the Application are trademarks of the Company or third parties, and no right or license is granted to use them. For the avoidance of doubt, the term Software and Application herein shall include its respective components, processes and design in its entirety.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-552777fd7c759\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:34:\"Remuneration for Medical Providers\";s:4:\"text\";s:300:\"Medical Providers that are working with MediCloud will be remunerated or incentivise by MediCloud based on the ongoing promotions that are being held by MediCloud Pte Ltd. By using this service, you acknowledge that the Medical Providers will be remunerated or incentivise for promoting this service.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277e4619f1d\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:15:\"Confidentiality\";s:4:\"text\";s:1330:\"You shall maintain in confidence all information and data relating to the Company, its services, products, business affairs, marketing and promotion plans or other operations and its associated companies which are disclosed to you by or on behalf of the Company (whether orally or in writing and whether before, on or after the date of this Agreement) or which are otherwise directly or indirectly acquired by you from the Company, or any of its affiliated companies, or created in the course of this Agreement. You shall further ensure that it, its officers, employees and agents only use such confidential information in order to perform the Services, and shall not without the Company’s prior written consent, disclose such information to any third-party nor use it for any other purpose. You shall only disclose such information to such officers, employees and agents as need to know it to fulfil its obligations under this Agreement.\n\nThe above obligations of confidentiality shall not apply to the extent that you can show that the relevant information:\n! was at the time of receipt already in the Recipient’s possession; is, or becomes in the future, public knowledge through no fault or omission of the Recipient; was received from a third-party having the right to disclose it; or is required to be disclosed by law.\n\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277bbe5bbf0\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:24:\"Personal Data Protection\";s:4:\"text\";s:3986:\"You agree and consent to the Company using and processing your Personal Data for the Purposes and in the manner as identified hereunder.\nFor the purposes of this Agreement, “Personal Data” means information about you, from which you are identifiable, including but not limited to your name, identification card number, birth certificate number, passport number, nationality, address, telephone number, credit or debit card details, race, gender, date of birth, email address, any information about you which you have provided to the Company in registration forms, application forms or any other similar forms and/or any information about you that has been or may be collected, stored, used and processed by the Company from time to time and includes sensitive personal data such as data relating to health, religious or other similar beliefs.\n\nThe provision of your Personal Data is voluntary. However if you do not provide the Company your Personal Data, your request for the Application may be incomplete and the Company will not be able to process your Personal Data for the Purposes outlined below and may cause the Company to be unable to allow you to use the Service.\n\nThe Company may use and process your Personal Data for business and activities of the Company which shall include, without limitation the following (“the Purpose”): To perform the Company’s obligations in respect of any contract entered into with you; To provide you with any services pursuant to the Terms of Use herein; To process your participation in any events, promotions, activities, focus groups, research studies, contests, promotions, polls, surveys or any productions and to communicate with you regarding your attendance thereto; Process, manage or verify your application for the Service pursuant to the Terms of Use herein; To validate and/or process payments pursuant to the Terms of Use herein; To develop, enhance and provide what is required pursuant to the Terms of Use herein to meet your needs; To process any refunds, rebates and or charges pursuant to the Terms of Use herein; To facilitate or enable any checks as may be required pursuant to the Terms of Use herein; To respond to questions, comments and feedback from you; To communicate with you for any of the purposes listed herein; For internal administrative purposes, such as auditing, data analysis, database records; For purposes of detection, prevention and prosecution of crime; For the Company to comply with its obligations under law; To send you alerts, newsletters, updates, mailers, promotional materials, special privileges, festive greetings from the Company, its partners, advertisers and or sponsors; To notify and invite you to events or activities organised by the Company, its partners, advertisers, and or sponsors; To share your Personal Data amongst the companies within the Company’s group of companies comprising the subsidiaries, associate companies and or jointly controlled entities of the holding company of the group (“the Group”) and with the Company’s and Group’s agents, third party providers, developers, advertisers, partners, event companies or sponsors who may communicate with you for any reasons whatsoever.\n\nIf you do not consent to the Company processing your Personal Data for any of the Purposes, please notify the Company using the support contact details as provided in the Application. If any of the Personal Data that you have provided to us changes, for example, if you change your e- mail address, telephone number, payment details or if you wish to cancel your account, please update your details by sending your request to the support contact details as provided in the Application.\n\nWe will, to the best of our abilities, effect such changes as requested within fourteen (14) working days of receipt of such notice of change. By submitting your information you consent to the use of that information as set out in the form of submission and in this Terms of Use.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277bd44b411\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:24:\"Third Party Interactions\";s:4:\"text\";s:2560:\"During use of the Service, you may enter into correspondence with, purchase goods and/or services from, or participate in promotions of third party providers, advertisers or sponsors showing their goods and/or services through the Service, Software and/or the Application. Any such activity, and any terms, conditions, warranties or representations associated with such activity, is solely between you and the applicable third-party. The Company and its licensors shall have no liability, obligation or responsibility for any such correspondence, purchase, transaction or promotion between you and any such third- party. The Group does not endorse any applications or sites on the Internet that are linked through the Service, Application and/or the Software, and in no event shall the Company, its licensors or the Group be responsible for any content, products, services or other materials on or available from such sites or third party providers. The Company provides the Service to you pursuant to the Terms of Use. You recognize, however, that certain third party providers of Medical, goods and/or services may require your agreement to additional or different Terms of Use prior to your use of or access to such goods or services, and the Company is not a party to and disclaims any and all responsibility and/or liability arising from such agreements between you and the third party providers.\n\nThe Company may rely on third party advertising and marketing supplied through the Service and other mechanisms to subsidize the Service and/or to earn additional revenue. By agreeing to the Terms of Use you agree to receive such advertising and marketing. If you do not want to receive such advertising you should notify us in writing or in accordance with the procedure determined by the Company. The Company reserves the right to charge you a higher fee for or deny you use of the Service should you choose not to receive these advertising services. This higher fee, if applicable, will be posted on the Company’s website located at http://www.MediCloud.com. You agree and allow the Company to compile and release information regarding you and your use of the Service on an anonymous basis as part of a customer profile or similar report or analysis. You agree that it is your responsibility to take all precautions in all actions and interactions with any third party Medical Provider, other third party providers, advertisers and/or sponsors you interact with through the Service and/or advertising or marketing material supplied through the Service.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277bee005ec\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:15:\"Indemnification\";s:4:\"text\";s:944:\"By agreeing to the Terms of Use upon using the Service, you agree that you shall defend, indemnify and hold the Company, its licensors and each such party’s parent organizations, subsidiaries, affiliates, officers, directors, members, employees, attorneys and agents harmless from and against any and all claims, costs, damages, losses, liabilities and expenses (including attorneys’ fees and costs) arising out of or in connection with: (a) your use of the Service, Software and/or the Application, your dealing with the third party Medical Providers, third party providers, partners, advertisers and/or sponsors, or (b) your violation or breach of any of the Terms of Use or any applicable law or regulation, whether or not referenced herein or (c) your violation of any rights of any third party, including third party Medical Providers arranged via the Service, or (d) your use or misuse of the Service, Software and/or the Application.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-558d01e3778ef\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:24:\"Disclaimer of Warranties\";s:4:\"text\";s:2006:\"THE COMPANY MAKES NO REPRESENTATION, WARRANTY, OR GUARANTEE AS TO THE RELIABILITY, TIMELINESS, QUALITY, SUITABILITY, AVAILABILITY, ACCURACY OR COMPLETENESS OF THE SERVICES, APPLICATION AND/OR THE SOFTWARE. THE COMPANY DOES NOT REPRESENT OR WARRANT THAT (A) THE USE OF THE SERVICE, APPLICATION AND/OR THE SOFTWARE WILL BE SECURE, TIMELY, UNINTERRUPTED OR ERROR-FREE OR OPERATE IN COMBINATION WITH ANY OTHER HARDWARE, SOFTWARE, SYSTEM OR DATA, (B) THE SERVICE WILL MEET YOUR REQUIREMENTS OR EXPECTATIONS, (C) ANY STORED DATA WILL BE ACCURATE OR RELIABLE, (D) THE QUALITY OF ANY PRODUCTS, SERVICES, INFORMATION, OR OTHER MATERIALS PURCHASED OR OBTAINED BY YOU THROUGH THE APPLICATION WILL MEET YOUR REQUIREMENTS OR EXPECTATIONS, (E) ERRORS OR DEFECTS IN THE APPLICATION AND/ OR THE SOFTWARE WILL BE CORRECTED, OR (F) THE APPLICATION OR THE SERVER(S) THAT MAKE THE APPLICATION AVAILABLE ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS, OR (G) THE APPLICATION AND/OR THE SOFTWARE TRACKS YOU OR THE VEHICLE USED BY THE Medical PROVIDER. THE SERVICE IS PROVIDED TO YOU STRICTLY ON AN “AS IS” BASIS. ALL CONDITIONS, REPRESENTATIONS AND WARRANTIES, WHETHER EXPRESS, IMPLIED, STATUTORY OR OTHERWISE, INCLUDING, WITHOUT LIMITATION, ANY IMPLIED WARRANTY OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, OR NON-INFRINGEMENT OF THIRD PARTY RIGHTS, ARE HEREBY EXCLUDED AND DISCLAIMED TO THE HIGHEST AND MAXIMUM EXTENT. THE COMPANY MAKES NO REPRESENTATION, WARRANTY, OR GUARANTEE AS TO THE RELIABILITY, SAFETY, TIMELINESS, QUALITY, SUITABILITY OR AVAILABILITY OF ANY SERVICES, INCLUDING BUT NOT LIMITED TO THE THIRD PARTY Medical SERVICES OBTAINED BY OR FROM THIRD PARTIES THROUGH THE USE OF THE SERVICE, APPLICATION AND/OR THE SOFTWARE. YOU ACKNOWLEDGE AND AGREE THAT THE ENTIRE RISK ARISING OUT OF YOUR USE OF THE SERVICE, AND ANY THIRD PARTY SERVICES, INCLUDING BUT NOT LIMITED TO THE THIRD PARTY Medical SERVICES REMAINS SOLELY AND ABSOLUTELY WITH YOU AND YOU SHALL HAVE NO RECOURSE WHATSOEVER TO THE COMPANY.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-558d01a839d96\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:15:\"Internet Delays\";s:4:\"text\";s:427:\"THE SERVICE, APPLICATION AND/OR THE SOFTWARE MAY BE SUBJECT TO LIMITATIONS, DELAYS, AND OTHER PROBLEMS INHERENT IN THE USE OF THE INTERNET AND ELECTRONIC COMMUNICATIONS INCLUDING THE DEVICE USED BY YOU OR THE THIRD PARTY Medical PROVIDER BEING FAULTY, NOT CONNECTED, OUT OF RANGE, SWITCHED OFF OR NOT FUNCTIONING. THE COMPANY IS NOT RESPONSIBLE FOR ANY DELAYS, DELIVERY FAILURES, DAMAGES OR LOSSES RESULTING FROM SUCH PROBLEMS.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-558d016fe1491\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:23:\"Limitation of Liability\";s:4:\"text\";s:3187:\"ANY CLAIMS AGAINST THE COMPANY BY YOU SHALL IN ANY EVENT BE LIMITED TO THE AGGREGATE AMOUNT OF ALL AMOUNTS ACTUALLY PAID BY AND/OR DUE FROM YOU IN UTILISING THE SERVICE DURING THE EVENT GIVING RISE TO SUCH CLAIMS. IN NO EVENT SHALL THE COMPANY AND/OR ITS LICENSORS BE LIABLE TO YOU OR ANYONE FOR ANY DIRECT, INDIRECT, PUNITIVE, ECONOMIC, FUTURE SPECIAL, EXEMPLARY, INCIDENTAL, CONSEQUENTIAL OR OTHER DAMAGES OR LOSSES OF ANY TYPE OR KIND (INCLUDING PERSONAL INJURY, EMOTIONAL DISTRESS AND LOSS OF DATA, GOODS, REVENUE, PROFITS, USE OR OTHER ECONOMIC ADVANTAGE). THE COMPANY AND/OR ITS LICENSORS SHALL NOT BE LIABLE FOR ANY LOSS, DAMAGE OR INJURY WHICH MAY BE INCURRED BY OR CAUSED TO YOU OR TO ANY PERSON FOR WHOM YOU HAVE BOOKED THE SERVICE FOR, INCLUDING BUT NOT LIMITED TO LOSS, DAMAGE OR INJURY ARISING OUT OF, OR IN ANY WAY CONNECTED WITH THE SERVICE, APPLICATION AND/OR THE SOFTWARE, INCLUDING BUT NOT LIMITED TO THE USE OR INABILITY TO USE THE SERVICE, APPLICATION AND/OR THE SOFTWARE, ANY RELIANCE PLACED BY YOU ON THE COMPLETENESS, ACCURACY OR EXISTENCE OF ANY ADVERTISING, OR AS A RESULT OF ANY RELATIONSHIP OR TRANSACTION BETWEEN YOU AND ANY THIRD PARTY PROVIDER, ADVERTISER OR SPONSOR WHOSE ADVERTISING APPEARS ON THE WEBSITE OR IS REFERRED TO BY THE SERVICE, APPLICATION AND/OR THE SOFTWARE, EVEN IF THE COMPANY AND/OR ITS LICENSORS HAVE BEEN PREVIOUSLY ADVISED OF THE POSSIBILITY OF SUCH DAMAGES.\n\nTHE COMPANY DOES NOT AND WILL NOT ASSESS NOR MONITOR THE SUITABILITY, LEGALITY, ABILITY, MOVEMENT OR LOCATION OF ANY THIRD PARTY PROVIDERS INCLUDING THIRD PARTY Medical PROVIDERS, ADVERTISERS AND/OR SPONSORS AND YOU EXPRESSLY WAIVE AND RELEASE THE COMPANY FROM ANY AND ALL LIABILITY, CLAIMS OR DAMAGES ARISING FROM OR IN ANY WAY RELATED TO THE THIRD PARTY PROVIDERS INCLUDING THIRD PARTY Medical PROVIDERS, ADVERTISERS AND/OR SPONSORS. THE COMPANY WILL NOT BE A PARTY TO DISPUTES, NEGOTIATIONS OF DISPUTES BETWEEN YOU AND SUCH THIRD PARTY PROVIDERS INCLUDING THIRD PARTY Medical PROVIDERS, ADVERTISERS AND/OR SPONSORS. WE CANNOT AND WILL NOT PLAY ANY ROLE IN MANAGING PAYMENTS BETWEEN YOU AND THE THIRD PARTY PROVIDERS, INCLUDING THIRD PARTY Medical PROVIDERS, ADVERTISERS AND/OR SPONSORS. RESPONSIBILITY FOR THE DECISIONS YOU MAKE REGARDING SERVICES AND PRODUCTS OFFERED VIA THE SERVICE, SOFTWARE AND/OR THE APPLICATION (WITH ALL ITS IMPLICATIONS) RESTS SOLELY WITH AND ON YOU. YOU EXPRESSLY WAIVE AND RELEASE THE COMPANY FROM ANY AND ALL LIABILITY, CLAIMS, CAUSES OF ACTION, OR DAMAGES ARISING FROM YOUR USE OF THE SERVICE, SOFTWARE AND/OR THE APPLICATION, OR IN ANY WAY RELATED TO THE THIRD PARTIES INCLUDING THIRD PARTY Medical PROVIDERS, ADVERTISERS AND/OR SPONSORS INTRODUCED TO YOU BY THE SERVICE, SOFTWARE AND/OR THE APPLICATION.\n\nTHE QUALITY OF THE THIRD PARTY Medical SERVICES SCHEDULED THROUGH THE USE OF THE SERVICE IS ENTIRELY THE RESPONSIBILITY OF THE THIRD PARTY Medical PROVIDER WHO ULTIMATELY PROVIDES SUCH Medical SERVICES TO YOU. YOU UNDERSTAND, THEREFORE, THAT BY USING THE SERVICE, YOU MAY BE EXPOSED TO Medical THAT IS POTENTIALLY DANGEROUS, OFFENSIVE, HARMFUL TO MINORS, UNSAFE OR OTHERWISE OBJECTIONABLE, AND THAT YOU USE THE SERVICE AT YOUR OWN RISK.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-558d005474392\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:6:\"Notice\";s:4:\"text\";s:672:\"The Company may give notice by means of a general notice on the Application, electronic mail to your email address in the records of the Company, or by written communication sent by Registered mail or pre-paid post to your address in the record of the Company. Such notice shall be deemed to have been given upon the expiration of 48 hours after mailing or posting (if sent by Registered mail or pre-paid post) or 1 hour after sending (if sent by email). You may give notice to the Company (such notice shall be deemed given when received by the Company) by letter sent by courier or registered mail to the Company using the contact details as provided in the Application.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-558cff514e753\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:10:\"Assignment\";s:4:\"text\";s:288:\"The agreement as constituted by the Terms of Use as modified from time to time may not be assigned by you without the prior written approval of the Company but may be assigned without your consent by the Company. Any purported assignment by you in violation of this section shall be void.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-558d000e85177\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:7:\"General\";s:4:\"text\";s:2704:\"This Agreement shall be governed by Singapore law, without regard to the choice or conflicts of law provisions of any jurisdiction, and any disputes, actions, claims or causes of action arising out of or in connection with the Terms of Use or the Service shall be subject to the exclusive jurisdiction of the courts of Singapore to which you hereby agree to submit to. In the event that the law in an Alternate Country does not allow jurisdiction to be that of the courts of Singapore or where judgment of a Singaporean court is unenforceable in the Alternate Country, unresolved disputes shall be referred to the Singapore International Arbitration Centre (‘SIAC’), in accordance with the Rules of the SIAC as modified or amended from time to time (the “Rules”) by a sole arbitrator appointed by the mutual agreement of the Parties (the “Arbitrator”). If Parties are unable to agree on an arbitrator, the Arbitrator shall be appointed by the President of SIAC in accordance with the Rules.\n\nThe seat and venue of the arbitration shall be Singapore, in the English language and The fees of the Arbitrator shall be borne equally by the Parties, provided that the Arbitrator may require that such fees be borne in such other manner as the Arbitrator determines is required in order for this arbitration clause to be enforceable under applicable law.\n\nNo joint venture, partnership, employment, or agency relationship exists between you, the Company or any third party provider as a result of the Terms of Use or use of the Service. If any provision of the Terms of Use is held to be invalid or unenforceable, such provision shall be struck and the remaining provisions shall be enforced to the fullest extent under law. This shall, without limitation, also apply to the applicable law and jurisdiction as stipulated above. The failure of the Company to enforce any right or provision in the Terms of Use shall not constitute a waiver of such right or provision unless acknowledged and agreed to by the Company in writing. The Terms of Use comprises the entire agreement between you and the Company and supersedes all prior or contemporaneous negotiations or discussions, whether written or oral (if any) between the parties regarding the subject matter contained herein.\n\nYou hereby agree that the Company is entitled to terminate this Agreement immediately in the event that you are found to be in breach of any of the terms stipulated in this Agreement. For the avoidance of doubt, the termination of this Agreement shall not require the Company to compensate, reimburse or cover any cost incurred by you in the course of you acquiring Services from the Medical provider under this Agreement.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}}}}s:10:\"prev_width\";i:0;}}'),(610,302,'_spyropress_builder_data','a:1:{s:25:\"builder-row-55277c5ecafa3\";a:4:{s:4:\"type\";s:17:\"one_col_row_class\";s:7:\"options\";a:0:{}s:7:\"columns\";a:1:{s:28:\"builder-column-55277c5ecaff6\";a:3:{s:4:\"type\";s:6:\"col_11\";s:9:\"col_class\";s:41:\"span12 col-sm-12 column_first column_last\";s:7:\"modules\";a:5:{s:28:\"builder-module-55277c63e5f8c\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:38:\"MEDICLOUD SINGAPORE DATA USE STATEMENT\";s:4:\"text\";s:734:\"Your privacy is important to us and we are committed to ensuring that our collection, use and/or disclosure of your personal data is in compliance with the Personal Data Protection Act 2012, its subsidiary legislation and the guidelines issued by the Personal Data Protection Commission.<br /> <br /> \n\nThis Data Use Statement set outs how your personal data may be collected, used, and/ or disclosed by us. For the purposes set out below, it may be necessary to collect, use and/or disclose personal data about your beneficiaries, trustees, nominees, dependents, assignees, assureds, or guarantors (where applicable) as well (your personal data and such other personal data to be collectively referred to as the “Personal Data”).\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277c7dc420f\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:27:\"COLLECTION OF PERSONAL DATA\";s:4:\"text\";s:1082:\"We may collect the Personal Data in the following ways:<br />\nwhen any form is completed and submitted to us with your consent in relation to any product or service offered by us, whether in hard copy or electronic copy through web or mobile applications and whether an insurance policy is issued or not; in the course of any communication or exchange between you and us in relation to any product or service offered by us, including face-to-face exchanges, telephone calls, letters, fax and e-mail;\nwhen you visit or access our website or provide any information through our website or web or mobile applications; when we receive information from third parties such as your employer, medical practitioners, hospitals, clinics, motor workshops, travel agencies or banks, etc; when you participate in any events organized by us such as recruitment fairs, functions, seminars, and contests; from cookies, or other technology deployed for the collection of statistical data on our website, web and mobile applications; and images, photographs, videos, CCTV footage or voice recordings.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277ca70b4a8\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:20:\"USE OF PERSONAL DATA\";s:4:\"text\";s:2515:\"We may use the Personal Data for the following purposes:<br /> \n\nevaluating financial needs for the purposes of providing recommendations of products and services offered by us; assessing and processing any application or request received by us in relation to any product or service offered by us; verifying and validating identity; underwriting risks in relation to a contract of insurance; requesting and collecting premiums, payments, or debts; reviewing, assessing and/ or processing insurance claims; making payments; providing communication in relation to any product or service offered by us, including policy updates, changes in applicable terms or conditions, status of policy, etc; administering, maintaining, managing and operating the products and services offered by us; promoting the products and services offered by us; conducting market and actuarial research and analysis to help us improve the products or services offered by us or to develop new products or services; managing our administrative and business operations; facilitating our management of business or commercial risks; insuring or reinsuring our risks; performing or updating transactions on your account; maintaining the security of our premises (including the use of security cameras); provision of training to our employees or financial adviser representatives; facilitating any business transactions, including corporate restructuring, mergers, acquisitions, or asset disposals; in the course of legal proceedings; investigating or addressing feedback or complaints received; reporting, preventing, detecting and investigating potential unlawful or improper activity, including suspicious transactions, fraud and money-laundering; delivery or mailing of certificates, correspondence, statements, invoices, reports or notices to you which may disclose certain personal data about you on the envelopes/mail packages; recruitment; organization of functions, seminars, and contests and communications with you on the same; ensuring compliance with applicable foreign and domestic laws and regulations, codes of practice and/ or guidelines including disclosure to any stock exchange and any applicable treaty or agreement applicable to us; attending to regulatory or audit enquiries; assisting in regulatory investigations or law enforcement; complying with MediCloud’s group policies and procedures and any other purposes directly relating to the administering and/or managing your relationship, account and/or policy(ies) with us.\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277ccc69ea0\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:27:\"DISCLOSURE OF PERSONAL DATA\";s:4:\"text\";s:3494:\"Where necessary, we may, for the purposes set out above and such other purposes as we may have advised you, disclose the Personal Data to the following,whether in Singapore or overseas:corporations within the MediCloud Group; prospective or actual business partners, investors, assignees or transferees; our financial adviser representatives; financial advisers, agents, brokers, or affinity partners who distribute or promote our products; agents, contractors or third party service providers we have engaged in connection with insurance underwriting and/ or claims, including medical practitioners, hospitals, clinics, surveyors, loss adjusters, private investigators, motor workshops, and legal advisers; agents, contractors or third party service providers we have engaged to provide such services as marketing and research, communications, telecommunications, telemarketing, customer servicing, information technology, data entry or processing, printing, dispatch, mail distribution, payment, training, data storage or archival, disaster recovery and business continuity; banks, CPF agent banks, credit card companies and their respective service providers; our insurers or reinsurers; our professional advisers, including auditors and legal advisers; Credit Bureau (Singapore);  debt collection agencies; the owner of any policy of insurance underwritten by us where you are a named insured, trustee, assignee, dependents or beneficiary or where you are an employee, your employer who has a group insurance policy with us; your family, relatives, appointed administrator(s) or executor(s) of your estate or affairs and their professional advisers; insurance industry associations, including the Life Insurance Association Singapore and the General Insurance Association Singapore; foreign or domestic regulators or law enforcement agencies, including the Police, Corrupt Practices Investigation Bureau, Singapore Customs, Monetary Authority of Singapore, Central Provident Fund Board , Inland Revenue Authority of Singapore, Land Transport Authority, Ministry of Manpower and Ministry of Health; any party to a dispute before (and including) a court of law, tribunal, arbitrator or dispute resolution center such as the Financial Industry Disputes Resolution Centre; any party you authorize us to disclose the Personal Data to; and any fund managers, custodians, clearing houses and brokers etc.Withdrawal of Consent, Access and Correction of Personal Data\n<br /><br />\nShould you wish to:<br />\nmake any enquiries relating to our collection, use, or disclosure of the Personal Data, or obtain access to your personal data held by us for the preceding 12 months, or make any correction to such Personal Data, or\nwithdraw any consent that you have previously given to us in relation to your personal data,Please contact us at info@MediCloud.com.sg\n<br /><br />\n\nPlease Note That:\nany request for access to your personal data may be subject to a fee;any withdrawals of consents are subject to there being no legal or contractual restrictions preventing you from doing so; and make any correction to such Personal Data, or the withdrawal of certain consents may result in our inability to continue to provide certain products or services or in the termination of a contract or contracts entered into with us, and we hereby reserve our rights in such event.\n\nComplaints:\nShould you wish to lodge a complaint regarding treatment of your personal data please contact us at info@MediCloud.com.sg\";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}s:28:\"builder-module-55277d196afdc\";a:3:{s:11:\"module_name\";s:4:\"Text\";s:4:\"type\";s:14:\"WP_Widget_Text\";s:8:\"instance\";a:4:{s:5:\"title\";s:27:\"CUSTOMER SERVICE COMMITMENT\";s:4:\"text\";s:745:\"MediCloud will make every effort to provide a high level of service expected by all our policyholders. If on any occasion our service falls below the standard of your expectation, the procedure below explains what you can do: Your first point of contact should always be your insurance agent or broker. Alternatively, you may submit your feedback to the MediCloud Manager in charge of the matter you are raising.We will acknowledge receipt of your feedback within 3 working days whilst we look into the matter you raised. We will contact you for further information if required within 7 working days and provide you with a full reply within 14 working days.If the outcome of your complaint is not handled to your satisfaction, you can write to: \";s:6:\"filter\";b:1;s:22:\"custom_container_class\";s:19:\"privacy-policy-para\";}}}}}s:10:\"prev_width\";i:0;}}'),(633,310,'_wp_attached_file','2014/12/HomePhone1.png'),(634,310,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:400;s:6:\"height\";i:775;s:4:\"file\";s:22:\"2014/12/HomePhone1.png\";s:5:\"sizes\";a:2:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:22:\"HomePhone1-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}s:6:\"medium\";a:4:{s:4:\"file\";s:22:\"HomePhone1-155x300.png\";s:5:\"width\";i:155;s:6:\"height\";i:300;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:11:{s:8:\"aperture\";i:0;s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";i:0;s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";i:0;s:3:\"iso\";i:0;s:13:\"shutter_speed\";i:0;s:5:\"title\";s:0:\"\";s:11:\"orientation\";i:0;}}'),(636,311,'_wp_attached_file','2015/04/DownloadBG2.jpg'),(637,311,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:2000;s:6:\"height\";i:650;s:4:\"file\";s:23:\"2015/04/DownloadBG2.jpg\";s:5:\"sizes\";a:3:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:23:\"DownloadBG2-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:22:\"DownloadBG2-300x98.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:98;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:5:\"large\";a:4:{s:4:\"file\";s:24:\"DownloadBG2-1024x333.jpg\";s:5:\"width\";i:1024;s:6:\"height\";i:333;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:11:{s:8:\"aperture\";i:0;s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";i:0;s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";i:0;s:3:\"iso\";i:0;s:13:\"shutter_speed\";i:0;s:5:\"title\";s:0:\"\";s:11:\"orientation\";i:0;}}'),(644,1,'_post_views_count','81'),(645,302,'_page_options','a:4:{s:12:\"onepage_menu\";s:2:\"11\";s:11:\"page_layout\";s:5:\"white\";s:10:\"top_header\";s:6:\"custom\";s:14:\"teaser_disable\";a:1:{i:0;s:1:\"1\";}}'),(651,129,'_page_options','a:9:{s:11:\"page_layout\";s:5:\"white\";s:10:\"top_header\";s:6:\"custom\";s:18:\"teaser_content_pos\";s:4:\"left\";s:11:\"header_logo\";s:59:\"http://medicloud.sg/wp-content/uploads/2014/12/LogoIcon.png\";s:13:\"header_teaser\";s:135:\"We Got You Covered<br>\r\n<div class=\"subtext\">\r\nA simple, fun and free way to book your medical appointments in 3 simple steps\r\n</div>\r\n\";s:7:\"buttons\";a:2:{i:0;a:3:{s:15:\"teaser_btn_type\";s:7:\"ios-btn\";s:15:\"teaser_btn_text\";s:23:\"Download for <b>iOS</b>\";s:15:\"teaser_btn_link\";s:85:\"https://itunes.apple.com/WebObjects/MZStore.woa/wa/viewSoftware?id=972694931&amp;mt=8\";}i:1;a:3:{s:15:\"teaser_btn_type\";s:11:\"android-btn\";s:15:\"teaser_btn_text\";s:32:\"Launching soon on <b>Android</b>\";s:15:\"teaser_btn_link\";s:1:\"#\";}}s:9:\"animation\";s:10:\"bounceInUp\";s:5:\"delay\";s:3:\"0.5\";s:11:\"intro_image\";s:61:\"http://medicloud.sg/wp-content/uploads/2014/12/HomePhone1.png\";}'),(652,300,'_page_options','a:4:{s:12:\"onepage_menu\";s:2:\"11\";s:11:\"page_layout\";s:5:\"white\";s:10:\"top_header\";s:6:\"custom\";s:14:\"teaser_disable\";a:1:{i:0;s:1:\"1\";}}'),(658,296,'_page_options','a:4:{s:12:\"onepage_menu\";s:2:\"11\";s:11:\"page_layout\";s:5:\"white\";s:10:\"top_header\";s:6:\"custom\";s:14:\"teaser_disable\";a:1:{i:0;s:1:\"1\";}}');
/*!40000 ALTER TABLE `wp_postmeta` ENABLE KEYS */;
