 each of them – are responsible for the fact whether this product would be great or ordinary. It is possible to raise the whole product up only through raising smalls on a new level. So, this is what we are busy now. We spend our time and attention exactly to these things.','Hello world!','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','publish','open','open','','hello-world-2','','','2014-11-22 10:34:07','2014-11-22 10:34:07','',0,'http://ckthemes.com/ray/?p=1',0,'post','',1),(250,1,'2015-04-02 15:49:42','2015-04-02 15:49:42','','Pricing Table two','','publish','closed','closed','','pricing-table-two','','','2015-04-02 15:49:42','2015-04-02 15:49:42','',0,'http://ckthemes.com/ray/?post_type=pricingtable&amp;p=232',0,'pricingtable','',0),(251,1,'2015-04-03 06:40:47','2015-04-03 06:40:47','','Game','','publish','open','open','','game','','','2015-04-03 06:40:47','2015-04-03 06:40:47','',0,'http://ckthemes.com/ray/?page_id=239',0,'page','',0),(252,1,'2015-04-08 08:26:51','2015-04-08 08:26:51',' ','','','publish','open','open','','252','','','2015-04-08 08:26:51','2015-04-08 08:26:51','',0,'http://localhost/medicloud/?p=252',9,'nav_menu_item','',0),(253,1,'2015-04-08 09:08:32','2015-04-08 09:08:32','<p>Your Name (required)<br />\r\n    [text* your-name] </p>\r\n\r\n<p>Your Email (required)<br />\r\n    [email* your-email] </p>\r\n\r\n<p>Subject<br />\r\n    [text your-subject] </p>\r\n\r\n<p>Your Message<br />\r\n    [textarea your-message] </p>\r\n\r\n<p>[submit \"Send\"]</p>\n[your-subject]\n[your-name] <mshafraz@gmail.com>\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n--\r\nThis e-mail was sent from a contact form on medicloud (http://medicloud.sg)\nmshafraz@gmail.com\nReply-To: [your-email]\n\n\n\n\n[your-subject]\nmedicloud <surenshanaka89@gmail.com>\nMessage Body:\r\n[your-message]\r\n\r\n--\r\nThis e-mail was sent from a contact form on medicloud (http://localho