 embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefor\r\n\r\n</div>\r\n</div>','Medicloud Terms','','inherit','open','open','','296-revision-v1','','','2015-04-10 06:11:04','2015-04-10 06:11:04','',296,'http://iamurbanmade.com/demo/medicloud/?p=298',0,'revision','',0),(299,1,'2015-04-10 06:12:59','2015-04-10 06:12:59','','TERMS OF USE','','publish','open','open','','299','','','2015-06-26 06:01:20','2015-06-26 06:01:20','',0,'http://iamurbanmade.com/demo/medicloud/?p=299',1,'nav_menu_item','',0),(300,1,'2015-04-10 06:18:52','2015-04-10 06:18:52','','Privacy Policy','','publish','open','open','','privacy-policy','','','2015-06-26 06:57:55','2015-06-26 06:57:55','',0,'http://iamurbanmade.com/demo/medicloud/?page_id=300',0,'page','',0),(301,1,'2015-04-10 06:18:52','2015-04-10 06:18:52','','Privacy Policy','','inherit','open','open','','300-revision-v1','','','2015-04-10 06:18:52','2015-04-10 06:18:52','',300,'http://iamurbanmade.com/demo/medicloud/?p=301',0,'revision','',0),(302,1,'2015-04-10 06:19:33','2015-04-10 06:19:33','','PDPA','','publish','open','open','','pdpa','','','2015-04-17 05:00:16','2015-04-17 05:00:16','',0,'http://iamurbanmade.com/demo/medicloud/?page_id=302',0,'page','',0),(303,1,'2015-04-10 06:19:33','2015-04-10 06:19:33','','PDPA','','inherit','open','open','','302-revision-v1','','','2015-04-10 06:19:33','2015-04-10 06:19:33','',302,'http://iamurbanmade.com/demo/medicloud/?p=303',0,'revision','',0),(305,1,'2015-04-10 06:21:21','2015-04-10 06:21:21','','PRIVACY POLICY','','publish','open','open','','privacy-policy','','','2015-06-26 06:01:20','2015-06-26 06:01:20','',0,'http://iamurbanmade.com/demo/medicloud/?p=305',2,'nav_menu_item','',0),(306,1,'2015-04-10 06:48:28','2015-04-10 06:48:28','<div class=\"terms_container\"><span class=\"terms_title\">MEDICLOUD PRIVACY NOTICE </span>  <br />\r\n				This Privacy Notice (“Notice”) describes how MediCloud and the group of companies comprising the subsidiaries, associate companies and or jointly controlled entities of the holding company of the group (“the Company”) will use your Personal Data.<br />\r\n\r\n				This Personal Data Protection Notice (“Notice”) describes how MediCloud and its holding company, associate companies and jointly controlled entitiesuse your Personal Data.\r\n\r\n				The Company offers information and a method for transportation providers, drivers and vehicle operators to schedule, obtain and establish contact with Passengers and or Customers, but does not and does not intend to provide transportation services or act in any way as a taxi operator, transportation carrier or provider.\r\n\r\n				The Company provides its service by using the mobile application supplied to you via mobile devices, smartphones and tablets (using operating systems such as iOS, Android, Blackberry and Windows), and downloading, installing or using any associated software supplied by the Company (“MediCloud App”) which overall purpose is to enable persons seeking medical services to be matched with the party providing the service (collectively, the \"Service\")\r\n				<br /> \r\n			</div>\r\n\r\n\r\n			<div class=\"terms_container\"> <span class=\"terms_title\">COLLECTION OF PERSONAL DATA</span> <br />\r\n				“Personal Data” means information about you, from which you are identifiable, including but not limited to your name, address, telephone number, your device type, model, brand and IMEI, vehicle registration, model and make, number, National Registration Identity Card, credit card details, race, gender, date of birth, financial background, personal interests, email address, your occupation, any information about you which you have provided to the Company in registration forms, application forms or any other similar forms and/or any information about you that has been or may be collected, stored, used and processed by the Company from time to time and includes sensitive personal data such as data relating to health, religious or other similar beliefs.\r\n				<br /><br />\r\n				The provision of your Personal Data is voluntary. However if you do not provide the Company your Personal Data, the Company will not be able to process your Personal Data for the Purposes and Additional Purposes outlined below.<br /><br />\r\n\r\n				If you are a doctor using the MediCloud app, supplier or service provider, provision of your Personal Data is mandatory and failure to provide your Personal Data may be a breach of laws or regulatory requirements, and may cause the Company to be unable to engage you to provide services via the MediCloud App or products or issue payments to you for products or services provided.<br /><br />\r\n\r\n\r\n				Sources from which your Personal Data may be obtained\r\n				In addition to the Personal Data you provide to the Company directly, the Company may collect your Personal Data from a variety of sources such as:\r\n				when you fill up application or registration forms or other similar forms whether online or otherwise;\r\n				when you download and use the MediCloud app whether as a provider of services or a seeker of services;\r\n				from publicly available sources such as directories;\r\n				from the Company’s Facebook pages, if you follow, like or are a fan of such pages;\r\n				from credit reporting agencies;\r\n				when you interact and communicate with the Company at any events or activities;\r\n				when you enter contests or participate in campaigns organized by the Company;\r\n				from various entities or divisions under the Company; or\r\n				by using the Company’s websites, which include all websites operated by the Company and under the names of its respective brands (“Websites”). Your personal data may also be collected from cookies used on the Websites.\r\n				Purposes of Processing\r\n				The Company may use and process your Personal Data for business and activities of the Company which shall include, without limitation the following (“the Purpose”):-<br /> <br />\r\n				Where you are a customer of the services provided through the Company:\r\n				to perform the Company’s obligations in respect of any contract entered into with you; \r\n				to provide you with any service you have requested; \r\n				to process your subscriptions and to deliver the services to you; \r\n				where you have requested to download and use the MediCloud App, to process your request, to deliver the MediCloud App to you and to provide you a license for the use of the MediCloud App; \r\n				to process your participation in any events, activities, focus groups, research studies, contests, promotions, polls, surveys or any productions; \r\n				to process, manage or verify your application for subscription with the Company and to provide you the benefits offered to subscribers; \r\n				to validate your bookings and process payments relating to any products or services you have requested; \r\n				to understand and analyse our sales as well as your needs and preferences; \r\n				to develop, enhance and provide products and services to meet your needs; \r\n				to process exchanges or product returns; \r\n				Where you are a doctor vendor, supplier or service provider:<br />\r\n\r\n				for the purposes of engaging you to provide services or products; \r\n				to facilitate or enable any checks as may be required by the Company in order to engage you; \r\n				to process payments relating to any products or services you have provided or require; \r\n				to contact you or your company; \r\n			</div>\r\n\r\n\r\n\r\n			<div class=\"terms_container\"><span class=\"terms_title\">GENERAL:</span>  <br />\r\n				to respond to questions, comments and feedback from you; \r\n				to communicate with you for any of the purposes listed in this Notice; \r\n				for internal administrative purposes, such as auditing, data analysis, database records; \r\n				for purposes of detection, prevention and prosecution of crime; \r\n				for the Company to comply with its obligations under law; \r\n				and you agree and consent to the Company using and processing your Personal Data for the Purposes and in the manner as identified in this Notice. <br />  <br />\r\n				Marketing and Promotional Purposes<br />\r\n				The Company may also use and process your data for other purposes such as (“Additional Purposes”):-<br />\r\n				to send you alerts, newsletters, updates, mailers, promotional materials, special privileges, festive greetings from the Company, its partners, sponsors or advertisers;\r\n				to notify and invite you to events or activities organised by the Company, its partners, sponsors or advertisers;\r\n				to process your registration to participate in or attend an event or activity and to communicate with you regarding your attendance at the event or activity;\r\n				to share your Personal Data with its partners, advertisers, event companies or sponsors who may communicate with you to market their products, services, events or promotions;\r\n\r\n				by way of post, telephone call, short message service (SMS), by hand and/or by email.<br />\r\n\r\n\r\n				If you do not consent to the Company processing your Personal Data for the Additional Purposes please notify the Company using the contact details stated below.<br /><br />\r\n				Transfer of Personal Data<br />\r\n				Your Personal Data may be transferred to, stored, used and processed in a jurisdiction other than Singapore, to companies within the Company’s group which are located outside of Singapore \r\n				and/or where the Company’s servers are located outside of Singapore. You understand and consent to the transfer of your Personal Data out of Singapore as described herein.<br /><br />\r\n				Disclosure to Third Parties\r\n				Your personal data may be transferred, accessed or disclosed to third parties for the Purposes and Additional Purposes. Further, the Company may engage other companies, service providers or individuals to perform functions on its behalf, and consequently may provide access or disclose to your Personal Data to such service providers or third parties. The third parties referred to in this Section include (without limitation):-<br />\r\n				The Company partners and advertisers, which include parties with whom the Company collaborates with for certain events, programmes and activities;\r\n				event management companies and event sponsors\r\n				marketing research companies;<br />\r\n				service providers, including information technology (IT) service providers for infrastructure, software and development work;\r\n				professional advisors and external auditors, including legal advisors, financial advisors and consultants; and\r\n				governmental authorities to comply with statutory, regulatory and governmental requirements.<br />\r\n				Your Personal Data may also be shared in connection with a corporate transaction, such as a sale of a subsidiary or a division, merger, consolidation, or asset sale, or in the unlikely event of winding-up.<br />\r\n				Access & Correction Requests and Inquiries, Limiting the Processing of Personal Data\r\n				Subject to any exceptions under applicable laws, you may request for access to and/or request correction of your Personal Data, request to limit the processing of your Personal Data for the Additional Purposes and/or make any inquiries regarding your Personal Data by contacting:-<br /><br />\r\n\r\n				Customer Service Department<br />\r\n				MediCloud Pte Ltd<br />\r\n				Email : info@medicloud.sg<br /><br />\r\n\r\n				Operating Hours : 10am – 7pm from Monday – Friday (excluding Public Holidays)<br />\r\n				<br /> \r\n\r\n\r\n\r\n\r\n				Links to Third-Party Websites<br />\r\n				The Websites may contain links to third parties\' websites. Please note that the Company is not responsible for the collection, use, maintenance, sharing, or disclosure of data and information by such third parties. If you provide information directly to such sites, the privacy policy and terms of service on those sites are applicable and the Company is not responsible for the information processing practices or privacy policies of such sites.<br /><br />\r\n				Personal Information from Minors and Other Individuals\r\n				As a parent or legal guardian, please do not allow a minor (individuals under 18 years of age) under your care to submit Personal Data to the Company. In the event that such Personal Data is provided to the Company, you hereby consent to the processing of the minor’s Personal Data and personally accept and agree to be bound by this Notice and take responsibility for his or her actions.<br /><br />\r\n\r\n				In some circumstances you may have provided personal data relating to other individuals (such as your spouse, family members or friends) and in such circumstances you represent and warrant that you are authorised to provide their personal data to the Company and you have obtained their consent for their personal data to be processed and used in the manner as set forth in this Notice.<br /><br />\r\n				Acknowledgement and Consent\r\n				By communicating with the Company, using the Company’s services, purchasing products from the Company or by virtue of your engagement with the Company for any reason whatsoever, you acknowledge that you have read and understood this Notice and agree and consent to the use, processing and transfer of your Personal Data by the Company as described in this Notice.<br /><br />\r\n\r\n				The Company shall have the right to modify, update or amend the terms of this Notice at any time by placing the updated Notice on the Websites. By continuing to communicate with the Company, by continuing to use the Company’s services, purchasing products from the Company or by your continued engagement with the Company following the modifications, updates or amendments to this Notice, such actions shall signify your acceptance of such modifications, updates or amendments.<br /><br />\r\n\r\n				In the event of any conflict between the version in English and other language versions, the English version shall prevail.<br />\r\n\r\n			</div>','Privacy Policy','','inherit','open','open','','300-revision-v1','','','2015-04-10 06:48:28','2015-04-10 06:48:28','',300,'http://iamurbanmade.com/demo/medicloud/300-revision-v1/',0,'revision','',0),(307,1,'2015-04-10 06:51:19','2015-04-10 06:51:19','','Privacy Policy','','inherit','open','open','','300-revision-v1','','','2015-04-10 06:51:19','2015-04-10 06:51:19','',300,'http://iamurbanmade.com/demo/medicloud/300-revision-v1/',0,'revision','',0),(309,1,'2015-04-10 07:06:55','2015-04-10 07:06:55','','Medicloud Terms','','inherit','open','open','','296-revision-v1','','','2015-04-10 07:06:55','2015-04-10 07:06:55','',296,'http://iamurbanmade.com/demo/medicloud/296-revision-v1/',0,'revision','',0),(310,1,'2015-04-10 09:15:46','2015-04-10 09:15:46','','HomePhone','','inherit','open','open','','homephone-2','','','2015-04-10 09:15:46','2015-04-10 09:15:46','',129,'http://iamurbanmade.com/demo/medicloud/wp-content/uploads/2014/12/HomePhone1.png',0,'attachment','image/png',0),(311,1,'2015-04-10 09:16:54','2015-04-10 09:16:54','','DownloadBG','','inherit','open','open','','downloadbg-3','','','2015-04-10 09:16:54','2015-04-10 09:16:54','',0,'http://iamurbanmade.com/demo/medicloud/wp-content/uploads/2015/04/DownloadBG2.jpg',0,'attachment','image/jpeg',0),(312,1,'2015-04-11 07:44:39','2015-04-11 07:44:39','','Terms','','inherit','open','open','','296-revision-v1','','','2015-04-11 07:44:39','2015-04-11 07:44:39','',296,'http://medicloud.sg/296-revision-v1/',0,'revision','',0),(313,1,'2015-04-11 07:46:01','2015-04-11 07:46:01','','Medicloud Terms','','inherit','open','open','','296